import React, { useEffect, useState } from "react";
import fit from "../../Images/fit.png";
import { Link, useLocation, useHistory } from "react-router-dom";
import { useCookies } from "react-cookie";
import classNames from 'classnames';

const Navbar = () => {
  const [isMenuOpened, setIsMenuOpened] = useState(false);
  const [user, setUser] = useState(null);
  const [cookie, removeCookie] = useCookies(["token", "user_id", "role_id"]);
  const [role, setRole] = useState(false);
  const history = useHistory();

  useEffect(() => {
    setUser(cookie.user_id);
    setRole(cookie.role_id);
  }, [cookie]);

  const location = useLocation();

  const toggleMenu = () => {
    setIsMenuOpened(!isMenuOpened);
  };

  const logout = () => {
    removeCookie('token');
    removeCookie('user_id');
    removeCookie('role_id');
    history.push("/");
  };

  return (
    <header className="fixed top-0 left-0 right-0 z-50 border-b bg-[#f5f5f5]">
      <nav className="max-w-screen h-[6rem] flex flex-wrap items-center justify-between mx-auto p-4 bg-[#f5f5f5]">
        <Link to="/" className="flex items-center ">
          <img src={fit} className="mr-3 h-20" alt="CraftVine Logo" />
        </Link>
        <div className="flex md:order-2">
          {user ? (
            <>
              {role === "trainer" ? (
                <Link to="/AccountTrainers">
                  <img
                    className="rounded-full h-10 w-10 ml-3 hidden md:block"
                    src="https://cdn.pixabay.com/photo/2015/10/05/22/37/blank-profile-picture-973460_1280.png"
                    alt="Profile"
                  />
                </Link>
              ) : (
                <Link to="/Account">
                  <img
                    className="rounded-full h-10 w-10 ml-3 hidden md:block"
                    src="https://cdn.pixabay.com/photo/2015/10/05/22/37/blank-profile-picture-973460_1280.png"
                    alt="Profile"
                  />
                </Link>
              )}
            </>
          ) : (
            <Link to="/login">
              <button className="bg-red-700 hover:bg-black rounded-full text-white h-10 px-4">
                Signin | Signup
              </button>
            </Link>
          )}
        </div>

        <div className="md:hidden">
          <button
            onClick={toggleMenu}
            className="block text-black hover:text-red-700 focus:outline-none"
          >
            <svg
              className="w-6 h-6"
              fill="none"
              stroke="currentColor"
              viewBox="0 0 24 24"
              xmlns="http://www.w3.org/2000/svg"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth="2"
                d="M4 6h16M4 12h16m-7 6h7"
              ></path>
            </svg>
          </button>
        </div>
        <div
          className={`items-center justify-between ${
            isMenuOpened ? "block" : "hidden"
          } w-full md:flex md:w-auto md:order-1`}
        >
          <div className="flex justify-between">
            <div className="relative mt-3 md:hidden"></div>
            {(!user || !role) && (
              <Link to="/login" className="md:hidden self-start">
                <button className="bg-[#89B9AD] rounded-full text-white h-10 my-3 px-4">
                  Signin|Signup
                </button>
              </Link>
            )}
          </div>
          <ul className="flex flex-col p-4 md:p-0 mt-4 font-medium border border-gray-100 rounded-lg bg-[#f5f5f5] md:flex-row md:space-x-8 md:mt-0 md:border-0 md:bg-[#f5f5f5] dark:bg-[#f5f5f5] md:dark:bg-[#f5f5f5] ">
            <li>
              <Link
                to="/"
                className="block py-2 pl-3 pr-4 text-black bg-[#f5f5f5] rounded md:bg-transparent md:text-black md:p-0 md:dark:text-black"
                aria-current="page"
              >
                Home
              </Link>
            </li>
            <li>
              <Link
                to="/about"
                className={classNames(
                  'block py-2 pl-3 pr-4 rounded hover:bg-gray-100 md:hover:bg-transparent md:p-0',
                  'text-gray-900 dark:text-white md:dark:text-black',
                  { 'md:hover:text-black dark:hover:text-white': !isActive("/about") },
                  { 'md:hover:text-[#89B9AD] dark:hover:text-[#89B9AD]': isActive("/about") }
                )}
              >
                About
              </Link>
            </li>

            <li>
              <Link
                to="/trainers"
                className={classNames(
                  'block py-2 pl-3 pr-4 rounded hover:bg-gray-100 md:hover:bg-transparent md:p-0',
                  'text-gray-900 dark:text-white md:dark:text-black',
                  { 'md:hover:text-black dark:hover:text-white': !isActive("/trainers") },
                  { 'md:hover:text-gray-600 dark:hover:text-[#89B9AD]': isActive("/trainers") }
                )}
              >
                Trainers
              </Link>
            </li>
            <li>
              <Link
                to="/Exercises"
                className={classNames(
                  'block py-2 pl-3 pr-4 rounded hover:bg-gray-100 md:hover:bg-transparent md:p-0',
                  'text-gray-900 dark:text-white md:dark:text-black',
                  { 'md:hover:text-black dark:hover:text-white': !isActive("/Exercises") },
                  { 'md:hover:text-gray-600 dark:hover:text-[#89B9AD]': isActive("/Exercises") }
                )}
              >
                Workout
              </Link>
            </li>
            <li>
              <Link
                to="/contact"
                className={classNames(
                  'block py-2 pl-3 pr-4 rounded hover:bg-gray-100 md:hover:bg-transparent md:p-0',
                  'text-gray-900 dark:text-white md:dark:text-black',
                  { 'md:hover:text-black dark:hover:text-white': !isActive("/contact") },
                  { 'md:hover:text-gray-600 dark:hover:text-[#89B9AD]': isActive("/contact") }
                )}
              >
                Contact
              </Link>
            </li>
            <li>
              <div className="space-y-3 ">
                <button
                  className="flex items-center px-3 py-2 text-white transition-colors duration-300 transform rounded-lg dark:text-gray-200 hover:bg-gray-100 dark:hover:bg-gray-800 dark:hover:text-gray-200 hover:text-gray-700"
                  onClick={logout}
                >
                  <svg
                    xmlns="http://www.w3.org/2000/svg"
                    viewBox="0 0 24 24"
                    fill="currentColor"
                    aria-hidden="true"
                    className="h-5 w-5"
                  >
                    <path
                      fillRule="evenodd"
                      d="M12 2.25a.75.75 0 01.75.75v9a.75.75 0 01-1.5 0V3a.75.75 0 01.75-.75zM6.166 5.106a.75.75 0 010 1.06 8.25 8.25 0 1011.668 0 .75.75 0 111.06-1.06c3.808 3.807 3.808 9.98 0 13.788-3.807 3.808-9.98 3.808-13.788 0-3.808-3.807-3.808-9.98 0-13.788a.75.75 0 011.06 0z"
                      clipRule="evenodd"
                    ></path>
                  </svg>
                  <span className="mx-2 text-sm font-medium">Log Out</span>
                </button>
              </div>
            </li>
          </ul>
        </div>
      </nav>
    </header>
  );
};

export default Navbar;
